import Title from './Title'


export default function AllWilling(props) {
  const [showDetails, setshowDetails] = useState(false)



  return (
    <div>
          <Title text = {"Willings"}/>
        <button className='largeBtn' onClick={()=>setshowDetails(!showDetails)}>{props.wiling.name} </button>
      <div className='margin-10' style={{visibility: showDetails ? 'visible' : 'hidden' }}>
      {props.wiling.name} <br />
      {props.wiling.location} <br />
      {props.wiling.tWilling}
      </div>
    </div>
  )
}
